description:
Harvest Moon is one of those games that gives you hope for gaming. It is, almost certainly without a doubt, the most unlikely success in the history of the modern console market. Who on earth would have ever thought that a farming simulation series could have spawned five different iterations on four different consoles, PlayStation 2 being the most recent recipient with Harvest Moon: Save The Homeland, drawing the same cult of dedicated fans every time? In a business dominated by retreads and rehashes, it&amp;#039;s a surprising flash of originality.
                                                                  (IGN)

